import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

const AppPricing = () => {
  return (
    <section id="pricing" className="block pricing-block">
      <Container fluid>
        <div>
            <h2>Pricing &amp</h2>
        </div>
        <Row>
          <Col>1 of 1</Col>
        </Row>
      </Container>
    </section>
  );
};

export default AppPricing;
